# -*- coding: utf-8 -*-
"""
Given a string, find the length of the longest substring without repeating characters.

Example 1:

Input: "abcabcbb"
Output: 3
Explanation: The answer is "abc", which the length is 3.
Example 2:

Input: "bbbbb"
Output: 1
Explanation: The answer is "b", with the length of 1.
Example 3:

Input: "pwwkew"
Output: 3
Explanation: The answer is "wke", with the length of 3.
             Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
"""


class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        i = 0
        size = 0
        buffer_set = set()
        window_side = {}

        if not s:
            return 0
        while i < len(s):
            j = i
            while i <= j < len(s):
                # move one side of the window each time
                if s[j] in buffer_set:
                    # remove the character at i,
                    # since the left window will be moved to right
                    buffer_set.remove(s[i])
                    i += 1  # move the left side of window
                else:
                    window_side[i] = j
                    buffer_set.add(s[j])
                    j += 1
            break  # if for loop end, break

        size = self.get_max_window(window_side)
        return size

    @staticmethod
    def get_max_window(window_side):
        size = 0
        for k, v in window_side.items():
            tmp = v - k
            if tmp > size:
                size = tmp

        return size + 1


